import React from 'react'
import '../style.css';

function Row({make_ID, make_name, make_model}) {
    return (
        <div>
            <li className="w3-panel w3-card">
                <h3> <span>ID:   </span> {make_ID}</h3>
                <h3> <span>Make Name:   </span> {make_name}</h3>
                <h3> <span>Model Name:   </span>{make_model}</h3>
            </li>
        </div>
    )
}

export default Row
